__r("a9f4b1").extend({"shared.ok":"OK","header.OneTrust.cookie_settings":"Cookie Preferences","header.OneTrust.your_privacy":"Your Privacy","user_consent.cookie_banner.description.v2":"We use cookies and similar technologies to help personalise content, tailor and measure ads, and provide a better experience. By clicking %{acceptText} or turning an option on in %{preferencesText}, you agree to this, as outlined in our %{link_start}Cookie Policy%{link_end}. To change preferences or withdraw consent, please update your %{preferencesText}.","ccmp.cookies_banner.reject_all":"Continue without accepting","header.OneTrust.strictly_necessary_cookies":"Strictly Necessary Cookies","header.OneTrust.these_cookies_are_necessary_for_the_website_to_function_and_can":"These cookies are necessary for the website to function and can't be switched off in our systems. They are usually only set in response to actions you have taken which result in a request for services, such as setting your privacy preferences, logging in or filling in forms. You can set your browser to block or alert you about these cookies, but some parts of the site may not work as a result.","header.OneTrust.performance_cookies":"Performance Cookies","header.OneTrust.these_cookies_allow_us_to_count_visits_and_traffic_sources_so_w":"These cookies allow us to count visits and traffic sources so we can measure and improve the performance of our site. They help us know which pages are the most and least popular and see how visitors move around the site. If you do not allow these cookies, information from these cookies will not be used to help site performance.","header.OneTrust.functional_cookies":"Functional Cookies","header.OneTrust.these_cookies_allow_the_provision_of_enhance_functionality_and_p":"These cookies allow the provision of enhanced functionality and personalisation, such as videos and live chats. They may be set by us or by third-party providers whose services we have added to our pages. If you don't allow these cookies, then some or all of these functionalities may not function properly.","header.OneTrust.targeting_cookies":"Targeting Cookies","header.OneTrust.these_cookies_are_set_through_our_site_by_our_advertising_partne":"These cookies are set through our site by our advertising partners. They may be used by those companies to build a profile of your interests and show you relevant ads on other sites. They work by uniquely identifying your browser and device. If you don't allow these cookies, you will not experience our targeted advertising across different websites as a result of these cookies."});
